import React from "react";
import { Box } from "@mui/material";
import { LoadingButton } from "@mui/lab";

function Home() {
  return (
    <Box sx={{
      height: "100%",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    }}>
      <LoadingButton variant="outlined">最初のメモを作成</LoadingButton>
    </Box>
  )
}

export default Home;
